import React, {useState} from 'react';
import Carousel from '@brainhubeu/react-carousel';
import '@brainhubeu/react-carousel/lib/style.css';

function SliderInstructors() {
    return(
        <>
            <h1>Slider Prueba</h1>
            <br></br>
            <Carousel>
                <p>UNO SLIDER</p>
                <p>DOS SLIDER</p>
                <p>TRES SLIDER</p>
            </Carousel>
        </>
    )
}

export default SliderInstructors;
